import React from 'react'
import './regions.css';
import { Link } from 'react-router-dom';
export default function Regions() {
  return (
    <div className='regionscontainer'>
      <h3>Select Any Region:</h3>
      <select >
        <option><link to='/northern'>Northern</link></option>
        <option><Link>Malakand</Link></option>
        <option><Link>WaterShed</Link></option>
        <option><Link>Kohat</Link></option>
        <option><Link>DI khan</Link></option>
      </select>
    </div>
  )
}
